import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
const name="Hilal";
const lname="Ahmad";
//another challenge 
const date=new Date().toLocaleDateString();  
const curTime=new Date().toLocaleTimeString(); 
const image="https://picsum.photos/200/300"; 
const image1="https://picsum.photos/250/300"; 
const image2="https://picsum.photos/300/300"; 
const link="https://atmosbit.com"; 


ReactDOM.render(
  // this is when you do it with simple dive
  // <div>
  //   <h1>hello world</h1>
  // <p>lorem this new paragraph  </p>
  // </div>,
  // do it with array
  // [
  //   <h1>hello world</h1>,
  //   <p>lorem this new paragraph  </p>,
  // ],

  // now we are writing React Fragment
<>
<p>2 challenge is to show date </p>
<p>{`Date: ${date}`}</p>
<p>{`Date: ${curTime}`}</p>

<h1>hello this is React Fragmentation</h1>
<p>this is testing of React Fragmentation</p>
<>
Netfilx series
<ol>
  <li>orange</li>
  <li>car racing</li>
  <li>mountain</li>
  <li>swimming</li>
</ol>
</>
<h1>how to use expression in jsx</h1>
<>
<h1>My name is {name}</h1>
<p>{`now we are trying templete literal with my name ${name} ${lname}`}</p>
<img src={image} alt="new picture from lorem picsum"/>
<a href={link}>
<img src={image1} alt="tyr picture from lorem picsum"/></a>
<img src={image2} alt="random picture from lorem picsum"/>
</>
</>,

  document.getElementById("root")
);
